                        grid[i][j], grid[i - 1][j] = grid[i - 1][j], grid[i][j]
                        merge(i, j)
        elif direction == 1:
            for j in range(1, 4):
                for i in range(4):
                    if grid[i][j] == 0 and grid[i][j - 1] != 0:
                        grid[i][j], grid[i][j - 1] = grid[i][j - 1], grid[i][j]
                        merge(i, j)
        elif direction == 2:
