    distances[start[0]][start[1]] = 0

    # BFS to find the shortest distances
    queue = [(start[0], start[1])]
    while queue:
        x, y = queue.pop(0)
        for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < n and 0 <= ny < n and distances[nx][ny] == -1:
                distances[nx][ny] = distances[x][y] + 1
                queue.append((nx, ny))

    # Check if there's a path from the starting point to any other point
    for i in range(n):
        for j in range(n):
            if distances[i][j] == -1:
                return -1

    # Calculate the total distance
