def solution(stdin: str) -> str:
    binary = stdin.strip()
    octal = ""

    # Pad binary with zeros on the left until the number of digits is divisible by three
    while len(binary) % 3 != 0:
        binary = "0" + binary

    # Convert binary to octal
    for i in range(0, len(binary), 3):
        octal_digit = 0
        for j in range(i, i + 3):
            octal_digit = octal_digit * 2 + int(binary[j])
        octal += str(octal_digit)

    return octal

