def solution(stdin: str) -> str:
    N, *rows = stdin.split('\n')
    N = int(N)
    blocked = set()
    knight_pos = None
    for i, row in enumerate(rows):
        for j, cell in enumerate(row):
            if cell == '#':
                blocked.add((i+1, j+1))
            if cell == 'K':
                knight_pos = (i+1, j+1)

    if knight_pos is None:
        return '-1'

    def is_valid(pos):
        return 1 <= pos[0] <= N and 1 <= pos[1] <= N and pos not in blocked

    def get_moves(pos):
        moves = [(pos[0]+2, pos[1]+1), (pos[0]+2, pos[1]-1), (pos[0]-2, pos[1]+1), (pos[0]-2, pos[1]-1), (pos[0]+1, pos[1]+2), (pos[0]+1, pos[1]-2), (pos[0]-1, pos[1]+2), (pos[0]-1, pos[1]-2)]
        return [(r, c) for r, c in moves if is_valid((r, c))]

    def bfs(start, target):
        queue = [(start, 0)]
        visited = set()
        while queue:
            pos, steps = queue.pop(0)
            if pos == target:
                return steps
            if pos not in visited:
                visited.add(pos)
                for move in get_moves(pos):
                    queue.append((move, steps+1))
        return -1

    return bfs(knight_pos, (1, 1))

